Marie McCray's house warming party just ended and her neighbor, Ike, is helping her clean up. Marie makes Ike drop what he's doing so they can chit chat. Ike talks about his wife and how she's never around so Marie decides to help him with his loneliness by banging his brains out. After all, what are neighbors for?
